// Home.js (inside components directory)
import React from 'react';

const Home = () => {
    return (
        <div className="text-center">
            <h1 className="text-3xl font-semibold mt-8">Welcome to the Tailwind CSS App!</h1>
            <p className="mt-4 text-lg">
                This app helps you manage and calculate scores for your team using Tailwind CSS.
            </p>
            <p className="mt-4 text-lg">
                Navigate using the menu above to view the leaderboard or use the score calculator.
            </p>
        </div>
    );
};

export default Home;
